import React from 'react';

function Navbar({ parentSections }) {
  return (
    <nav className="w-64 h-screen fixed bg-gradient-to-r from-gray-900 to-gray-800 text-gray-300 shadow-lg overflow-y-auto border-r border-gray-700">
      <div className="p-6">
        <h2 className="text-3xl font-bold mb-6 text-indigo-400 text-center">Image Filters</h2>
        <ul className="space-y-8">
          {parentSections.map((parent) => (
            <li key={parent.id}>
              <a
                href={`#${parent.id}`}
                className="hover:text-indigo-300 text-xl transition-colors duration-300 block"
              >
                {parent.title}
              </a>
              <ul className="pl-4 mt-2 space-y-4">
                {parent.sections.map((section) => (
                  <li key={section.id}>
                    <a
                      href={`#${section.id}`}
                      className="hover:text-indigo-300 text-lg transition-colors duration-300 block"
                    >
                      {section.title}
                    </a>
                  </li>
                ))}
              </ul>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
